import React, {useState} from 'react';
import Header from '../../Header/Header';
import HomeContentGoals from "./HomeContentGoals";
import HomeContentMedia from "./HomeContentMedia";
import HomeContentLogin from "./HomeContentLogin";
import Footer from '../../Footer/Footer';
import {UserContext} from "../../../context/UserContext";

function Home() {

    const userLoggedIn = useState(UserContext);

    return (
        <div>
            <Header/>
            {userLoggedIn && <HomeContentGoals/>}
            {!userLoggedIn && <HomeContentMedia/>}
            {!userLoggedIn && <HomeContentLogin/>}
            <Footer/>
        </div>
    );
}

export default Home;
